import React from "react";
import { Grid, Typography } from "@mui/material";

import CustomBox from "../../components/CustomBox";
import MainImage from "../../assets/img/home/big_station.png";

function Main() {
  return (
    <Grid
      container
      spacing={2}
      justifyContent="center"
      alignItems="center"
      p={1}
      sx={{ marginTop: { xs: 10, lg: 10 } }}
    >
      <Grid item xs={4}>
        <CustomBox>
          <Typography
            fontSize={{ lg: 64, xs: 20 }}
            fontWeight={700}
            textAlign="left"
          >
            BANTO
          </Typography>
        </CustomBox>
        <CustomBox>
          <Typography
            fontSize={{ lg: 54, xs: 16 }}
            color="#BDBDBD"
            textAlign="left"
          >
            보조배터리
          </Typography>
          <Typography fontSize={{ lg: 54, xs: 16 }} textAlign="left">
            대여서비스
          </Typography>
        </CustomBox>
      </Grid>
      <Grid item xs={8}>
        <img src={MainImage} width="100%" />
      </Grid>
    </Grid>
  );
}

export default Main;
